/**
 * @brief Implementation of the function for the grids
 */

std::vector<std::vector<std::vector<double>>> BClnu::parse3DArray(const std::string& filename)
{
    std::ifstream file(filename);
    if (!file.is_open()) {
        throw std::runtime_error("Could not open file!");
    }

    // Struttura per 3D array
    std::vector<std::vector<std::vector<double>>> Grid;
    std::vector<std::vector<double>> level2;
    std::vector<double> level1;

    char c;
    std::string number;

    while (file >> std::noskipws >> c) {
        if (c == '[') {
            // Skip opening brackets, prepare for new levels
            continue;
        } else if (c == ']') {
            if (!number.empty()) { // Add the last number
                level1.push_back(std::stod(number));
                number.clear();
            }
            if (!level1.empty()) {
                level2.push_back(level1);
                level1.clear();
            } else if (!level2.empty()) {
                Grid.push_back(level2);
                level2.clear();
            }
        } else if (std::isdigit(c) || c == '.' || c == '-' || c == 'e' || c == 'E' || c == '+') {
            // Build a number, include scientific notation parts
            number += c;
        } else if (c == ',' || std::isspace(c)) {
            if (!number.empty()) { // End of number
                level1.push_back(std::stod(number));
                number.clear();
            }
        }
    }

    return Grid;
}

