/**
 * @brief Functions for the NLO
 */

std::vector<double> BClnu::ChebPoints(double a, double b, int n)
{
    std::vector<double> cos_values(n);
    for (int i = 0; i < n; i++)
    {
        double cos_val = std::cos(M_PI * (2.0 * (i + 1) - 1) / (2.0 * n));
        cos_values[i] = (a + b) / 2.0 + cos_val * (b - a) / 2.0;
    }
    return cos_values;
}

std::vector<double> BClnu::ChebCoefficients(double a, double b, int n, const std::vector<double>& fpoints)
{
    std::vector<double> c(n, 0.0);
    for (int i = 0; i < n; i++)
    {
        for (int j = 0; j < n; j++)
        {
            double cos_val = std::cos((2.0 * j + 1) * i * M_PI / (2.0 * n));
            c[i] += fpoints[j] * cos_val;
        }
        c[i] *= 2.0 / n;
    }
    return c;
}

double BClnu::ChebPolynomial(const std::vector<double>& c, double a, double b, double s)
{
    double x = (2.0 * s - a - b) / (b - a);
    double d = 0.0;
    double dd = 0.0;

    for (int i = c.size() - 1; i > 0; i--)
    {
        double sv = d;
        d = 2.0 * x * d - dd + c[i];
        dd = sv;
    }
    return x * d - dd + c[0] / 2.0;
}

double BClnu::nloX1Q2(int moment, const std::string& cNP, double Q2cut, double r)
{
    // Do not change these values
    const double rmin = 1.0 / 6.0;
    const double rmax = 1.0 / 3.0;
    const int orderm = 13;

    // Dictionary to grid elements relative to each NP contribution
    // Note that SR*T has no alphas contribution
    std::map<std::string, int> wc = { {"SM", 0}, {"VL", 1}, {"VR", 2}, {"SL2", 3}, {"SR2", 4}, {"VL2", 5},
                                    {"SLSR", 6}, {"VR2", 7}, {"VLVR", 8}, {"SLT", 9}, {"T2", 10} };

    std::vector<double> mpoints = ChebPoints(rmin, rmax, orderm);
    std::vector<double> fvalues(orderm);
    std::vector<double> q2values(orderm);

    for (int i = 0; i < orderm; ++i) {
        q2values[i] = Q2cut / omr2 * std::pow(1 - mpoints[i], 2);
    }

    for (int i = 0; i < orderm; ++i) {
        // Placeholder implementation: replace with actual grid values
        fvalues[i] = ChebPolynomial((grid_np_Q2moments)[wc[cNP]][moment][i], 0, std::pow(1 - mpoints[i], 2), q2values[i]);
    }

    std::vector<double> coeff = ChebCoefficients(rmin, rmax, orderm, fvalues);
    return ChebPolynomial(coeff, rmin, rmax, r);
    // return 0.;
}

