    double Elcuthat = elcut / mbkin;

    double mus = scale_alphas / mbkin;

    double mupi = MuPi / pow(mbkin, 2);
    double muG = MuG / pow(mbkin, 2);
    double rhoD = RhoD / pow(mbkin, 3);
    double rhoLS = RhoLS / pow(mbkin, 3);

    // We're considering the PERP basis
    // RhoD and RhoLS flags have to be set to 1 when the grids are available also for these ones

    int flagNLOMuG = 1, flagNLOMuPi = 1;
    int flagNLORhoD = 0, flagNLORhoLS = 0;

    double FLAGcf = (0.5 * (3. * (log(scale_muG))));
    double FLAGcD = 0., FLAGcs = 0.;

    double deltambkin1 = deltambkin(1);
    double deltambkin2 = deltambkin(2);
    double deltamcMS1 = deltamcMS(1);
    double deltamcMS2 = deltamcMS(2);
    double Rhodpert1 = RhoDPert(1) / pow(mbkin, 3);
